import React from "react";
import { Link } from "react-router-dom";

const TopMenu = () => {
  return (
    <div>
      <ul>
        <li style={{ display: "inline", padding: "5x" }}>
          <Link to="/">Home</Link>
        </li>
        <li style={{ display: "inline", padding: "5x" }}>
          <Link to="/contactus">Contact Us</Link>
        </li>
        <li style={{ display: "inline", padding: "5x" }}>
          <Link to="/products">Products</Link>
        </li>
      </ul>
    </div>
  );
};

export default TopMenu;
